import AsyncStorage from "@react-native-async-storage/async-storage";

const servers = async ()=>{
    try {
    const selectedServer = await AsyncStorage.getItem('selectedServer');
    if (ararangua !== null) {
        return 'http://ti.ararangua.sc.gov.br:10000';
    } else if (criciuma !== null) {
        return 'http://ti.criciuma.sc.gov.br:00000';
    } else {
        return 'default.server.url';
    }
} catch (error) {
    console.error("Erro ao acessar o AsyncStorage:", error);
    return 'error.server.url';
}
};
export default servers;
